ï»¿$(function () {
    $("#newsletter-email").focus(function () {
        $(this).val("");
    });
    
    $(".pricingtooltip").tooltip({ placement: 'top', trigger: 'hover' });
    
    $("#annual_button").attr("disabled", true);
    $("#annual_button").addClass("btn-success");

    $(".term-toggle").live('click', function (e) {
        var id = $(this).attr("id");

        if (id == "monthly_button") {
            $("#annual_button").attr("disabled", false);
            $("#monthly_button").attr("disabled", true);
            $("#monthly_button").addClass("btn-success");
            $("#annual_button").removeClass("btn-success");
          

        } else {
            $("#annual_button").attr("disabled", true);
            $("#annual_button").addClass("btn-success");
            $("#monthly_button").attr("disabled", false);
            $("#monthly_button").removeClass("btn-success");

        }

        $("div[class^=plan-price]").each(function (index) {
            if (id == "monthly_button") {
                var price = $(this).find(".month-price").val();
                $(this).find(".plan-price-amount").fadeIn('slow').text(price);
                $('.term').text("Per Month");
                var link = $(this).closest(".plan-container").find(".plan-actions a");
                $(link).attr("href", $(link).attr("href").replace("-annual", ""));
            } else {
                var price = $(this).find(".year-price").val();
                $(this).find(".plan-price-amount").fadeIn('slow').text(price);
                $('.term').text("Per Year (1 Month Free)");
                var link = $(this).closest(".plan-container").find(".plan-actions a");
                $(link).attr("href", $(link).attr("href") + "-annual");
            }

        });

    });

 

});


$(document).ready(function () {
    function filterPath(string) {
        return string
    .replace(/^\//, '')
    .replace(/(index|default).[a-zA-Z]{3,4}$/, '')
    .replace(/\/$/, '');
    }
    var locationPath = filterPath(location.pathname);
    $('a[href*=#]').each(function () {
        var thisPath = filterPath(this.pathname) || locationPath;
        if (locationPath == thisPath
    && (location.hostname == this.hostname || !this.hostname)
    && this.hash.replace(/#/, '')) {
            var $target = $(this.hash), target = this.hash;
            if (target) {
                var targetOffset = $target.offset().top;
                $(this).click(function (event) {
                    event.preventDefault();
                    $('html, body').animate({ scrollTop: targetOffset }, 800, function () {
                        location.hash = target;
                    });
                });
            }
        }
    });
});

